import React, { Component } from 'react';

import Post from '../post';

import './index.css';

class Body extends Component {
	render() {
		return (
			<div className='body'>
				<div className='inner-container'>
					<Post />
					<Post />
					<Post />
				</div>
			</div>
		);
	}
}

export default Body;
